import React from 'react';
import { Link } from 'react-router-dom';

import styles from './Home.sass'

function Home(props) {
  return (
      <div className={styles.home}>
        <h1 className={styles.heading}>emily lobel</h1>
        <h2 className={styles.welcome}>hi :)</h2>
        <p className={styles.iam}>i am a <Link to="/engineer" className="engineer">software engineer</Link>
        </p>
        <p className={styles.iam}>i am also an <Link to="/actor" className="actor">actor</Link>
        </p>
      </div>
  );
}

export default Home;
